import React from 'react';
import {Link} from "react-router-dom";

const Error = () => {
    return (
        <div>
            <h1>ОШИБКА</h1>
            <Link to="/login">Войти</Link>
            <Link to="/registration">Зарегистрироваться</Link>
        </div>
    );
};

export default Error;
